import React from "react";
import {
  Button,
  Checkbox,
  FormControlLabel,
  Backdrop,
  CircularProgress,
  List,
  ListItem,
  ListItemAvatar,
  Avatar,
  ListItemText,
} from "@material-ui/core";
import FolderIcon from "@material-ui/icons/Folder";

import { Header } from "../Header";

const viajes = useSelector((state) => state.busqueda);

export const BusquedaScreen = () => {
  return (
    <>
      <Header />
      <div className="auth__container" style={{ marginTop: "20px" }}>
        <h1>Busqueda</h1>
        <div>
          <List style={{ width: "100%" }}>
            {viajes.map((viaje) => (
              <ListItem button key={viaje.id}>
                <ListItemAvatar>
                  <Avatar>
                    <FolderIcon />
                  </Avatar>
                </ListItemAvatar>
                <ListItemText
                  primary={
                    <p style={{ textAlign: "center" }}>
                      Hora {viaje.horaViaje} hrs.
                    </p>
                  }
                  secondary={
                    <div style={{ display: "flex" }}>
                      <div style={{ textAlign: "center", margin: "0 8px" }}>
                        <p>{viaje.salida}</p>
                        <p>a</p>
                        <p>{viaje.destino}</p>
                      </div>
                      <div style={{ display: "flex", alignItems: "flex-end" }}>
                        <p>precio</p>
                      </div>
                    </div>
                  }
                />
              </ListItem>
            ))}
          </List>
        </div>
      </div>
    </>
  );
};
